/**
 * @internal
 * wrapper around user get_first to setup the index oid
 */
static int
_strApshTable_loop_get_first_wrapper(strApshTable_interface_ctx * wrap_ctx,
                                     strApshTable_ref_loop_ctx * loop_ctx_ref,
                                     strApshTable_ref_rowreq_ctx * rowreq_ctx_ref)
{
        int rc;

        DEBUGMSGTL(("internal:strApshTable:_strApshTable_loop_get_first_wrapper", "called\n"));

        rc = strApshTable_loop_get_first(wrap_ctx->user_ctx, loop_ctx_ref, rowreq_ctx_ref);
        /*
         * convert index to OID
         */
        if (SNMPERR_SUCCESS == rc) {
                netsnmp_assert((NULL != rowreq_ctx_ref) &&
                               (rowreq_ctx_ref->rowreq_ctx->oid_idx.oids ==
                                rowreq_ctx_ref->rowreq_ctx->oid_tmp));
                rowreq_ctx_ref->rowreq_ctx->oid_idx.len =
                    sizeof(rowreq_ctx_ref->rowreq_ctx->oid_tmp);
                rc = strApshTable_index_to_oid(&rowreq_ctx_ref->rowreq_ctx->oid_idx,
                                               &rowreq_ctx_ref->rowreq_ctx->tbl_idx);
                netsnmp_assert(rowreq_ctx_ref->rowreq_ctx->oid_idx.len !=
                               sizeof(rowreq_ctx_ref->rowreq_ctx->oid_tmp));
        }

        return rc;
}                               /* _strApshTable_loop_get_first_wrapper */

